package com.example.FusionPersona.dto.personaDto;

import io.swagger.v3.oas.annotations.media.Schema;
import io.swagger.v3.oas.annotations.tags.Tag;
import lombok.*;

import javax.validation.constraints.NotBlank;
import javax.validation.constraints.Size;

@Getter
@Setter
@NoArgsConstructor
@AllArgsConstructor
@Builder
public class GPersonaDto {
    @NotBlank
    @Schema(description = "ID of the Persona",
            example = "1", required = true)
    private Integer personaIdDto;
    @NotBlank
    @Size(min = 3, max = 50)
    @Schema(description = "Name of the Persona",
            example = "Walama The God Of Destruction", required = true)
    private String personaNameDto;
    @NotBlank
    @Schema(description = "byte[] StandardCharsets.UTF_8",
            example ="[]"
            , required = true)
    private byte[] personaImgDto;
}
